import React, { memo } from "react";

import {
  getSongCategoryAction,
  getSongCategoryListAction,
} from "./store/actionCreators";

import { SongListWrapper } from "./style";
export default memo(function LJSongList() {
  return (
    <SongListWrapper>
      <h2>LJSongs</h2>
    </SongListWrapper>
  );
});
